import {useState} from "react";

function App() {
  const [toDo, setTodo] = useState("");
  const onChange = (event) => {
    setTodo(event.target.value);
  }
  return(
    <>
    <h2>To Do List</h2>
    <input type="text" onChange={onChange} value={toDo}/>
    <button>Add To Do</button>
    </>
  )
}

export default App;
